import React, { Component } from 'react';
import './App.css';
import Filter from './Filter.js';
import Header from './Header.js';
import image1 from './image1.svg';

const clothes = [
  {name: "Halter Neck", type: "Shirt", occasion: "Party", img: image1},
  {name: "Spaghetti Top", type:"Shirt", occasion: "Party", img: "image2"},
  {name: "Cargo Pants", type:"Bottoms", occasion: "Casual", img: "image3"},
  {name: "LBD", type:"Dress", occasion: "Party", img: ""},
  {name: "Beach Dress", type:"Dress", occasion: "Casual", img: ""},
  {name: "Peplum Top", type: "Shirt", occasion: "Party", img: ""}, 
  {name: "Midi Dress", type: "Dress", occasion: "Party", img: ""},
  {name: "Fit and Flare", type: "Dress", occasion: "Party", img: ""},
  {name: "Satin Skirt", type: "Bottoms", occasion: "Party", img: ""},
  {name: "Denim Skirt", type: "Bottoms", occasion: "Casual", img: ""},
  {name: "Blouse", type: "Shirt", occasion: "Work", img: ""},
  {name: "Denims", type: "Bottoms", occasion: "Casual", img: ""}
]; 


class App extends Component {
  render() {
    return (

      <div id="body">
      <Header />
      <Filter items={clothes} />
      </div>
    );
  }
}

export default App;
